// HeaderPdf.js
import React from "react";
import { Link } from "react-router-dom";
import logo from '../../resources/mainpage/logo.png'
import "./HeaderPdf.css";

const HeaderPdf = () => {
  return (
    <div className="headerContainer container">
      <div className="row">
        <div className="col-md-6 logoStart">
          <div className="logo">
            <img src={logo} alt="logo" />
          </div>
        </div>
        <div className="col-md-6 buttonEnd">
          <Link to="/pdf-upload" className="btn pdf-button">
            ADD PDF
          </Link>
          <Link to="/unloading" className="btn">
            UN
          </Link>
          <Link to="/admin" className="btn">
            Admin
          </Link>
        </div>
      </div>
    </div>
  );
};

export default HeaderPdf;
